COPY public.personality_traits (id, code, blended_style_name, blended_style_desc, color_rgb, metadata, is_active, is_deleted, created_at, updated_at) FROM stdin;
1	DI	Charismatic Leader	Dynamic, confident, and people-centric, Charismatic Leaders chase ambitious goals while rallying others around a compelling vision. They are decisive, comfortable with risk, and quick to initiate change. Their enthusiasm is contagious, but they may overlook details or become impatient when others need more time to buy in.	234,51,36	{}	t	f	2025-12-14 09:43:21.176+05:30	2025-12-14 09:43:21.176+05:30
2	DS	Strategic Stabilizer	Strategic Stabilizers pair a results-oriented mindset with steady, methodical execution. They set clear targets and then build practical processes to reach them, paying attention to team harmony as much as to deadlines. Under heavy pressure they can appear blunt or inflexible, yet their calm resolve helps groups stay focused during turbulence.	255,115,49	{}	t	f	2025-12-14 09:43:21.183+05:30	2025-12-14 09:43:21.183+05:30
3	DC	Decisive Analyst	Analytical and forceful, Decisive Analysts demand logical, data-backed solutions delivered at speed. They challenge assumptions, slice through ambiguity, and set high performance bars. Their perfectionism drives excellence, though it can also create unrealistic expectations or strain relationships if diplomacy is neglected.	255,182,31	{}	t	f	2025-12-14 09:43:21.184+05:30	2025-12-14 09:43:21.184+05:30
4	ID	Energetic Visionary	Energetic Visionaries blend imaginativeideas with a bias for action. They persuade through storytelling, thrive on variety, and push projects forward with infectious optimism. Because they move fast, they may jump from one initiative to the next or skim past critical followthrough steps.	255,213,0	{}	t	f	2025-12-14 09:43:21.185+05:30	2025-12-14 09:43:21.185+05:30
5	IS	Supportive Energizer	Warm, encouraging, and service-minded, Supportive Energizers cultivate a positive team spirit while keeping an eye on practical needs. They excel at informal coaching and fostering collaboration. Conflict avoidance and difficulty saying "no" can sometimes lead to overcommitment or delayed tough decisions.	255,232,0	{}	t	f	2025-12-14 09:43:21.186+05:30	2025-12-14 09:43:21.186+05:30
6	IC	Creative Thinker	Creative Thinkers pair imaginative flair with thoughtful analysis. They enjoy brainstorming novel solutions, then polishing them with careful research and aesthetic sensitivity. Their high standards for both originality and accuracy can slow delivery if they become trapped in ideation or meticulous refinement.	221,215,48	{}	t	f	2025-12-14 09:43:21.187+05:30	2025-12-14 09:43:21.187+05:30
7	SD	Reliable Executor	Dependable and goal-driven, Reliable Executors convert strategic plans into orderly, trackable actions. They value consistency, outline clear procedures, and persevere until results are reached. When faced with sudden change they may resist altering proven methods, but once convinced they carry out new directives diligently.	0,186,204	{}	t	f	2025-12-14 09:43:21.188+05:30	2025-12-14 09:43:21.188+05:30
8	SI	Collaborative Optimist	Collaborative Optimists foster cohesion and morale through empathy, patience, and an upbeat outlook. They are attentive listeners who build consensus and smooth workflows. Their tendency to prioritize relationships can hinder direct feedback or delay necessary course corrections.	0,200,137	{}	t	f	2025-12-14 09:43:21.189+05:30	2025-12-14 09:43:21.189+05:30
9	SC	Dependable Specialist	Precise, loyal, and processoriented, Dependable Specialists deliver highquality work by adhering to standards and anticipating risks. They prefer stable environments where expertise is valued and roles are well defined. Excessive caution or reluctance to delegate may limit agility under fastchanging conditions.	0,179,85	{}	t	f	2025-12-14 09:43:21.19+05:30	2025-12-14 09:43:21.19+05:30
10	CD	Analytical Leader	Analytical Leaders couple rigorous logic with a drive for measurable achievement. They see patterns quickly, devise structured strategies, and hold teams accountable to objective metrics. Their unemotional style promotes fairness, yet it can be perceived as detached if interpersonal nuances are overlooked.	0,151,230	{}	t	f	2025-12-14 09:43:21.191+05:30	2025-12-14 09:43:21.191+05:30
11	CI	Logical Innovator	Logical Innovators integrate systematic reasoning with imaginative "whatif" exploration. They enjoy stretching boundaries while ensuring every concept is technically sound. Socially engaging but still evidencebased, they can spend too long perfecting models or convincing skeptics of unconventional ideas.	186,48,107	{}	t	f	2025-12-14 09:43:21.192+05:30	2025-12-14 09:43:21.192+05:30
12	CS	Structured Supporter	Structured Supporters are meticulous planners who keep teams grounded with well-documented workflows, risk logs, and clear quality checks. Courteous and patient, they provide quiet stability behind the scenes. Aversion to conflict and a preference for certainty may slow decisions when rapid action is required.	209,30,91	{}	t	f	2025-12-14 09:43:21.193+05:30	2025-12-14 09:43:21.193+05:30
\.
